import React, { Component } from 'react';

export default class AddItems extends Component {
	render() {
		return (
			<div>
				<div className='addItemsContainer'>
					<form>
						<input onChange={(e) => this.updadeInput(e)} type='text' />
					</form>
				</div>
			</div>
		);
	}

	updadeInput = (e) => {
		console.log(e);
	};
}
